import cart from './cart.dummy'

const users = [
    // {
    //     username: "anonymous",
    //     password: "123456",
    //     name: "Guest",
    //     cart: null
    // },
    {
        username: "admin0",
        password: "123456",
        name: "คุณมาโนช",
        cart: cart[0]
    },
    {
        username: "admina",
        password: "123456",
        name: "คุณเค",
        cart: cart[0]
    },
    {
        username: "adminb",
        password: "123456",
        name: "คุณมานะ",
        cart: cart[0]
    },
    {
        username: "adminc",
        password: "123456",
        name: "คุณมานี",
        cart: cart[0]
    },
    {
        username: "admin4",
        password: "123456",
        name: "คุณพี",
        cart: cart[1]
    }
]

export default users
